O programador declara o bloco (de threads ): tamanho irá variar entre 1 a 512 threads concorrentes; terá um formato 1D, 2D ou 3D; dimensões dos blocos em threads . Todos as threads num bloco executam o mesmo programa de thread ; As threads partilham os dados e sincronizam-se enquanto partilham o seu trabalho; As threads têm números de identificação dentro de um bloco; Os programas de threads utilizam os thread ID de forma a selecionar os trabalhos e endereçar os dados partilhados. float x = input[threadID];
float y = func(x);
output[threadID] = y;
